#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size != sizeof(int)) {
    return 0;
  }

  int http_errno_val = *((int*)data);

  if (http_errno_val >= 0 && http_errno_val <= HPE_UNEXPECTED_CONTENT_LENGTH) {
    const char* name = http_errno_name((enum http_errno)http_errno_val);
  }

  return 0;
}

#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>

extern const char * http_errno_name(enum http_errno);

const int max_valid_http_errno = HPE_PAUSED;

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size != sizeof(int)) {
    return 0;
  }

  int http_error = *((int*)data);

  if (http_error >= 0 && http_error <= max_valid_http_errno) {
    const char* name = http_errno_name(http_error);
  }

  return 0;
}
